import React from 'react';
import { motion } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCheck } from '@fortawesome/free-solid-svg-icons';

const SubscriptionPlans = () => {
  const pricingPlans = [
    {
      id: 'one-meal',
      title: 'One Meal a Day',
      price: 120,
      description: 'Lunch or Dinner',
      popular: false,
      features: [
        'Choose your meal of the day',
        'Free delivery',
        'Minimum commitment'
      ]
    },
    {
      id: 'two-meals',
      title: 'Two Meals a Day',
      price: 220,
      description: 'Lunch and Dinner',
      popular: true,
      features: [
        'Intermittent fasting friendly',
        'Non-veg & veg options',
        'Free delivery',
        'Premium menu options',
        'Priority customer support'
      ]
    },
    {
      id: 'family-plan',
      title: 'Family Plan',
      price: 440,
      description: 'Two meals for two people',
      popular: false,
      features: [
        'Perfect for couples',
        'Customizable meal preferences',
        'Free delivery',
        'Special weekend menu',
        'Premium customer support'
      ]
    }
  ];

  const scrollToSection = (sectionId) => {
    const section = document.getElementById(sectionId);
    if (section) {
      window.scrollTo({
        top: section.offsetTop - 80,
        behavior: 'smooth'
      });
    }
  };

  const formatPrice = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      maximumFractionDigits: 0
    }).format(amount);
  };

  return (
    <section id="subscription-plans" className="py-20 md:py-28 bg-gray-50 overflow-hidden section-fade relative">
      {/* Decorative Indian-inspired background elements */}
      <div className="absolute inset-0 overflow-hidden pointer-events-none">
        {/* Mandala-inspired circular patterns */}
        <div className="absolute top-10 left-10 w-32 h-32 opacity-5">
          <svg viewBox="0 0 100 100" className="w-full h-full text-primary">
            <circle cx="50" cy="50" r="45" fill="none" stroke="currentColor" strokeWidth="0.5"/>
            <circle cx="50" cy="50" r="35" fill="none" stroke="currentColor" strokeWidth="0.5"/>
            <circle cx="50" cy="50" r="25" fill="none" stroke="currentColor" strokeWidth="0.5"/>
            <circle cx="50" cy="50" r="15" fill="none" stroke="currentColor" strokeWidth="0.5"/>
            <path d="M50,5 L55,20 L50,35 L45,20 Z" fill="currentColor" opacity="0.3"/>
            <path d="M50,65 L55,80 L50,95 L45,80 Z" fill="currentColor" opacity="0.3"/>
            <path d="M5,50 L20,55 L35,50 L20,45 Z" fill="currentColor" opacity="0.3"/>
            <path d="M65,50 L80,55 L95,50 L80,45 Z" fill="currentColor" opacity="0.3"/>
          </svg>
        </div>

        <div className="absolute top-20 right-16 w-24 h-24 opacity-5">
          <svg viewBox="0 0 100 100" className="w-full h-full text-accent">
            <polygon points="50,10 61,35 90,35 69,57 79,82 50,70 21,82 31,57 10,35 39,35" fill="currentColor"/>
          </svg>
        </div>

        <div className="absolute bottom-16 left-20 w-28 h-28 opacity-5">
          <svg viewBox="0 0 100 100" className="w-full h-full text-primary">
            <path d="M50,10 Q70,30 90,50 Q70,70 50,90 Q30,70 10,50 Q30,30 50,10 Z" fill="none" stroke="currentColor" strokeWidth="1"/>
            <path d="M50,20 Q65,35 80,50 Q65,65 50,80 Q35,65 20,50 Q35,35 50,20 Z" fill="none" stroke="currentColor" strokeWidth="1"/>
          </svg>
        </div>

        <div className="absolute bottom-10 right-10 w-20 h-20 opacity-5">
          <svg viewBox="0 0 100 100" className="w-full h-full text-accent">
            <circle cx="50" cy="50" r="40" fill="none" stroke="currentColor" strokeWidth="1"/>
            <path d="M50,10 L50,90 M10,50 L90,50 M25,25 L75,75 M75,25 L25,75" stroke="currentColor" strokeWidth="0.5"/>
          </svg>
        </div>

        {/* Subtle paisley-inspired curves */}
        <div className="absolute top-1/2 left-0 w-16 h-32 opacity-3">
          <svg viewBox="0 0 50 100" className="w-full h-full text-primary">
            <path d="M10,10 Q40,20 45,50 Q40,80 10,90 Q5,70 5,50 Q5,30 10,10 Z" fill="currentColor"/>
          </svg>
        </div>

        <div className="absolute top-1/3 right-0 w-16 h-32 opacity-3 transform rotate-180">
          <svg viewBox="0 0 50 100" className="w-full h-full text-accent">
            <path d="M10,10 Q40,20 45,50 Q40,80 10,90 Q5,70 5,50 Q5,30 10,10 Z" fill="currentColor"/>
          </svg>
        </div>
      </div>

      <div className="container mx-auto px-4 md:px-6 relative z-10">
        {/* Modern section header with Indian-inspired accent */}
        <motion.div
          className="text-center max-w-3xl mx-auto mb-16"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
        >
          <div className="flex items-center justify-center mb-6">
            <div className="h-px bg-gradient-to-r from-transparent via-primary to-transparent w-24"></div>
            <div className="mx-4 w-3 h-3 bg-primary rounded-full"></div>
            <div className="h-px bg-gradient-to-r from-transparent via-primary to-transparent w-24"></div>
          </div>
          <h2 className="text-3xl md:text-4xl font-bold mb-4 text-gray-800">Choose Your Plan</h2>
          <p className="text-lg text-gray-600">Flexible options designed for every lifestyle</p>
        </motion.div>

        <div className="max-w-4xl mx-auto grid grid-cols-1 md:grid-cols-3 gap-8">
          {pricingPlans.map((plan, index) => (
            <motion.div
              key={plan.id}
              className={`bg-white rounded-2xl shadow-lg overflow-hidden relative transition-transform hover:scale-105 ${
                plan.popular ? "md:-mt-4 md:mb-4" : ""
              }`}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              {plan.popular && (
                <div className="absolute top-0 right-0 bg-accent text-white text-xs font-semibold px-4 py-1 uppercase rounded-bl-lg">
                  Popular
                </div>
              )}
              <div className="p-8 text-center border-b border-gray-100">
                <h3 className="text-2xl font-semibold mb-2">{plan.title}</h3>
                <div className="text-primary text-4xl font-bold">
                  {formatPrice(plan.price)}<span className="text-gray-400 text-lg font-normal">/day</span>
                </div>
                <p className="text-gray-600 mt-2">{plan.description}</p>
              </div>
              <div className="p-8">
                <ul className="space-y-4">
                  {plan.features.map((feature, idx) => (
                    <li key={idx} className="flex items-center">
                      <FontAwesomeIcon icon={faCheck} className="text-primary mr-3 h-4 w-4" />
                      <span>{feature}</span>
                    </li>
                  ))}
                </ul>
                <div className="mt-8 text-center">
                  <button
                    onClick={() => scrollToSection('daily-combos')}
                    className={`w-full py-3 rounded-full font-medium shadow-md transition-all ${
                      plan.popular 
                        ? "bg-accent hover:bg-orange-600 text-white" 
                        : "bg-primary hover:bg-primary/90 text-white"
